  return (
    <Provider store={store}>
      <AppLayout>
        <div>
          {isLoggedIn && <PostForm />}
          {mainPosts.map((post) => (
            <PostCard key={post.id} post={post} />
          ))}
        </div>
      </AppLayout>
    </Provider>
  );
};


